webpackJsonp([64697196351401],{426:function(e,i){e.exports={data:{markdownRemark:{html:'<h1>June 22, 2016</h1>\n<ul>\n<li>Michelle Noorali gave a quick introduction</li>\n<li>Antoine Legrand did a demo of [KPM]((<a href="https://github.com/kubespray/kpm">https://github.com/kubespray/kpm</a>)</li>\n<li>\n<p>Matt Farina gave an update on the SIG-apps survey</p>\n<ul>\n<li>The survey ends this Friday, so there are only two more days to collect data.</li>\n<li>The survey can be found <a href="http://goo.gl/forms/VFbJ0fjJYYSEgwND2">here</a>.</li>\n<li>Please help us share the survey and get as much feedback on running apps in kubernetes as possible!</li>\n<li>If you\'d like to help analyze the data, please contact @mattfarina.</li>\n</ul>\n</li>\n<li>\n<p>We discussed topics of interest with the group.</p>\n<ul>\n<li>The sig-apps members are interested in seeing some standardization when it comes to deploying, managing, and operating applications in Kubernetes. There was discussion around putting together a post or some documentation about common trends to try to bring them to light.</li>\n<li>There was also interest specifically around how people are actually using Kubernetes Jobs in actuality and seeing real-world examples of that.</li>\n</ul>\n</li>\n</ul>'},site:{siteMetadata:{sigs:["sig-api-machinery","sig-apps","sig-architecture","sig-auth","sig-autoscaling","sig-aws","sig-azure","sig-big-data","sig-cli","sig-cloud-provider","sig-cluster-lifecycle","sig-cluster-ops","sig-contributor-experience","sig-docs","sig-gcp","sig-ibmcloud","sig-instrumentation","sig-multicluster","sig-network","sig-node","sig-openstack","sig-product-management","sig-release","sig-scalability","sig-scheduling","sig-service-catalog","sig-storage","sig-testing","sig-ui","sig-vmware","sig-windows"]}}},pathContext:{slug:"/sig-apps/minutes/2016-06-22/"}}}});
